import React from 'react';

const NewsCard = ({ story, onClick }) => {
  if (!story) {
    return <div>No story data</div>;
  }

  return (
    <div className="news-card" onClick={() => onClick(story)}>
      <div className="news-card-emoji">{story.emoji_thumbnail}</div>
      <div className="news-card-body">
        <h2>{story.factual_headline}</h2>
        <div className="news-card-sources">
          <span>{story.source_articles.length} Sources</span>
        </div>
      </div>
    </div>
  );
};

export default NewsCard;
